import React from "react"
values = ["Licorice", "Bottle", "Feelings", "Objectives", "Victory", "Cat", "You Can't Get Dog Back HAHAHAHA"]
export const UltimateContext = React.createContext({
    value: "Dog",
    toggle: () => {},
})

const UltimateTheme = () => {
    return ({
        values, UltimateContext
    })
}

export default UltimateTheme;
